import React from 'react';
import { motion } from 'framer-motion';
import { 
  FiGithub, 
  FiLinkedin, 
  FiExternalLink, 
  FiMail, 
  FiPhone, 
  FiMapPin,
  FiArrowUp,
  FiHeart,
  FiCode
} from 'react-icons/fi';
import './Footer.css';

const Footer = () => {
  const currentYear = new Date().getFullYear();

  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: 'smooth'
    });
  };

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({
        behavior: 'smooth',
        block: 'start'
      });
    }
  };

  const navigationLinks = [
    { name: 'Home', href: 'hero' },
    { name: 'About', href: 'about' },
    { name: 'Experience', href: 'experience' },
    { name: 'Projects', href: 'projects' },
    { name: 'Skills', href: 'skills' },
    { name: 'Contact', href: 'contact' }
  ];

  const socialLinks = [
    {
      name: 'GitHub',
      icon: FiGithub,
      url: 'https://github.com/abdullah6930',
      color: '#333'
    },
    {
      name: 'LinkedIn',
      icon: FiLinkedin,
      url: 'https://www.linkedin.com/in/abdullahqadeerdev',
      color: '#0077B5'
    },
    {
      name: 'Portfolio',
      icon: FiExternalLink,
      url: 'https://abdullah-qadeer-portfolio.web.app/',
      color: '#0070f3'
    },
    {
      name: 'Email',
      icon: FiMail,
      url: 'mailto:abdullah.qadeer@example.com',
      color: '#ea4335'
    }
  ];

  const quickContact = [
    {
      icon: FiMail,
      label: 'Email',
      value: 'abdullah.qadeer@example.com',
      href: 'mailto:abdullah.qadeer@example.com'
    },
    {
      icon: FiPhone,
      label: 'Phone',
      value: '+92 XXX XXXXXXX',
      href: 'tel:+92XXXXXXXXX'
    },
    {
      icon: FiMapPin,
      label: 'Location',
      value: 'Remote / Pakistan',
      href: '#'
    }
  ];

  const skills = [
    'Unity 3D',
    'React.js',
    '.NET Core',
    'VR/AR',
    'C#',
    'JavaScript',
    'AI/ML'
  ];

  return (
    <footer className="footer">
      <div className="footer-background">
        <div className="footer-grid"></div>
        <div className="footer-glow"></div>
      </div>

      <div className="container">
        <div className="footer-content">
          {/* Main Footer Content */}
          <div className="footer-main">
            {/* Brand Section */}
            <motion.div 
              className="footer-brand"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
            >
              <div className="brand-logo">
                <span className="logo-text">AQ</span>
              </div>
              <h3>Abdullah Qadeer</h3>
              <p>Software Engineer specializing in Unity, VR/AR, and modern web technologies</p>
              <div className="brand-stats">
                <div className="stat">
                  <span className="stat-number">5+</span>
                  <span className="stat-label">Years Experience</span>
                </div>
                <div className="stat">
                  <span className="stat-number">15+</span>
                  <span className="stat-label">Projects Completed</span>
                </div>
              </div>
            </motion.div>

            {/* Navigation Links */}
            <motion.div 
              className="footer-nav"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.1 }}
              viewport={{ once: true }}
            >
              <h4>Navigation</h4>
              <ul>
                {navigationLinks.map((link, index) => (
                  <li key={index}>
                    <button
                      onClick={() => scrollToSection(link.href)}
                      className="nav-link"
                    >
                      {link.name}
                    </button>
                  </li>
                ))}
              </ul>
            </motion.div>

            {/* Quick Contact */}
            <motion.div 
              className="footer-contact"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.2 }}
              viewport={{ once: true }}
            >
              <h4>Get In Touch</h4>
              <div className="contact-list">
                {quickContact.map((contact, index) => (
                  <a 
                    key={index}
                    href={contact.href}
                    className="contact-item"
                  >
                    <contact.icon />
                    <div>
                      <span className="contact-label">{contact.label}</span>
                      <span className="contact-value">{contact.value}</span>
                    </div>
                  </a>
                ))}
              </div>
            </motion.div>

            {/* Technologies */}
            <motion.div 
              className="footer-skills"
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: 0.3 }}
              viewport={{ once: true }}
            >
              <h4>Technologies</h4>
              <div className="skills-tags">
                {skills.map((skill, index) => (
                  <span key={index} className="skill-tag">
                    {skill}
                  </span>
                ))}
              </div>
              <div className="availability">
                <div className="status-indicator"></div>
                <span>Available for new opportunities</span>
              </div>
            </motion.div>
          </div>

          {/* Social Links */}
          <motion.div 
            className="footer-social"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <h4>Connect With Me</h4>
            <div className="social-links">
              {socialLinks.map((social, index) => (
                <motion.a
                  key={index}
                  href={social.url}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="social-link"
                  whileHover={{ 
                    scale: 1.1,
                    backgroundColor: social.color,
                    borderColor: social.color
                  }}
                  transition={{ duration: 0.2 }}
                >
                  <social.icon />
                  <span>{social.name}</span>
                </motion.a>
              ))}
            </div>
          </motion.div>
        </div>

        {/* Footer Bottom */}
        <motion.div 
          className="footer-bottom"
          initial={{ opacity: 0 }}
          whileInView={{ opacity: 1 }}
          transition={{ duration: 0.5, delay: 0.5 }}
          viewport={{ once: true }}
        >
          <div className="footer-bottom-content">
            <div className="copyright">
              <p>
                © {currentYear} Abdullah Qadeer. Built with{' '}
                <FiHeart className="heart-icon" />{' '}
                using{' '}
                <FiCode className="code-icon" />{' '}
                React.js
              </p>
            </div>
            
            <div className="footer-meta">
              <span>Last updated: {new Date().toLocaleDateString()}</span>
              <span>•</span>
              <span>Version 1.0</span>
            </div>
          </div>

          {/* Back to Top Button */}
          <motion.button
            className="back-to-top"
            onClick={scrollToTop}
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            initial={{ opacity: 0, scale: 0 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.3, delay: 0.6 }}
            viewport={{ once: true }}
          >
            <FiArrowUp />
          </motion.button>
        </motion.div>
      </div>
    </footer>
  );
};

export default Footer;
